import React, { Component } from 'react';
import 'react-responsive-carousel/lib/styles/carousel.min.css'; // requires a loader
import { Carousel } from 'react-responsive-carousel';
const cake1 = require('../../../images/carousel/carouselCake1.jpeg');
const cake2 = require('../../../images/carousel/carouselCake2.jpg');
const cake3 = require('../../../images/carousel/carouselCake3.jpeg');

class DemoCarousel extends Component {
  render() {
    return (
      <Carousel
        showThumbs={false}>
        <div>
          <img alt='cake' src={cake1}/>
          <p className="legend">Legend 1</p>
        </div>
        <div>
          <img alt='cake' src={cake2} />
          <p className="legend">Legend 2</p>
        </div>
        <div>
          <img alt='cake' src={cake3} />
          <p className="legend">Legend 3</p>
        </div>
      </Carousel>
    );
  }
}


export {DemoCarousel as Carousel};
